import { Link } from "react-router-dom";

const EVENTS = [
  { id: "event1", title: "event 1" },
  { id: "event2", title: "event 2" },
  { id: "event3", title: "event 3" },
  { id: "event4", title: "event 4" },
];

function EventPage() {
  return (
    <>
      <h1>Event Page</h1>
      <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={prod.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}

export default EventPage;
